import "./App.css";

import ToDo from './components/ToDo/ToDo';
import NewToDo from './components/NewToDo/NewToDo';

function App() {
  const DUMMY_TO_DOS = [
    {
      id: "1",
      title: "Do laundry",
      dueTime: new Date(2022, 10, 3, 16, 0),
      priority: "low",
      complete: false
    },
    {
      id: "2",
      title: "Do homework",
      dueTime: new Date(2022, 10, 5, 12, 0),
      priority: "high",
      complete: false
    },
    {
      id: "3",
      title: "Dinner with Tony",
      dueTime: new Date(2022, 10, 3, 18, 0),
      priority: "medium",
      complete: false
    },
  ];

  const [ToDos, setToDos] = useState(DUMMY_TO_DOS);

  const onAddToDo = () => {
    setToDos(prevExpenses => {
      return [expense, ...prevExpenses];
    });
  }

  return (
    <div className="App">
      <h2>To Do List</h2>
      <NewToDo onAddToDo={onAddToDo}></NewToDo>
      <ToDo items={DUMMY_TO_DOS}></ToDo>
    </div>
  );
}

export default App;
